<template>
  <span :style="avatarStyle" />
</template>

<script>
const GROUPS = [
  {
    rows: 3,
    cols: 6,
    img: "url('data:image/jpeg;base64,')",
  },
  {
    rows: 3,
    cols: 5,
    img: "url('data:image/jpeg;base64,')",
  },
];

export default {
  props: {
    size: {
      type: [Number, String],
      default: 48,
    },
    rounded: {
      type: [Number, String],
      default: 0,
    },
    toyNumber: {
      type: [Number, String],
      default: 1,
      validator(value) {
        return value >= 1 && value <= 18;
      },
    },
    group: {
      type: [Number, String],
      default: 1,
      validator(value) {
        return value >= 1 && value <= 2;
      },
    },
  },
  computed: {
    currentGroup() {
      return GROUPS[this.group - 1];
    },
    posX() {
      return (this.toyNumber - 1) % this.currentGroup.cols;
    },
    posY() {
      return Math.floor((this.toyNumber - 1) / this.currentGroup.cols);
    },
    avatarStyle() {
      return {
        display: "inline-block",
        width: this.size + "px",
        height: this.size + "px",
        backgroundImage: this.currentGroup.img,
        backgroundRepeat: "no-repeat",
        backgroundSize:
          this.size * this.currentGroup.cols +
          "px " +
          this.size * this.currentGroup.rows +
          "px",
        margin: "8px",
        borderRadius: this.rounded + "px",
        backgroundPositionX: `-${this.posX * this.size}px`,
        backgroundPositionY: `-${this.posY * this.size}px`,
      };
    },
  },
};
</script>
